import React, { Component } from 'react';
const { AccountClient } = require('../matcha_grpc_web_pb');
const { imageData } = require('../matcha_pb');


class Test extends Component {
	constructor(props) {
		super(props);
		this.state = {
			data: ''
		}
	}

	getImages = () => {
		return new Promise((resolve, reject) => {
			const client = new AccountClient('http://localhost:8080');
			const request = new imageData();
			client.imageTest(request, {}, (err, reply) => {
					if (err) {
						console.log(err.code);
						console.log(err.message);
					} else {
						const data = reply.getImage_asB64();
						console.log(`com?`);
						resolve(data);
					}
				})
		})
	}

	// updateData = (newData) => {
	// 	return new Promise((resolve, reject) => {
	// 		this.setState({data: newData});
	// 	})
	// }

	allSet = async () => {
		const data = await this.getImages();
		this.setState({data: data})
		console.log(this.state.data);
	}

	componentDidMount() {
		this.allSet();
	}

	render() {
		const data = this.state.data;
		const Example =  ({ data }) => <img src={`data:image/jpeg;base64,${data}`} alt='' />
		return (
			<div>
				<Example data={data} />
				<div>test page</div>
			</div>
		);
	}
}

export default Test;
